import React from 'react'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'
import Check from './../../Component/Check'
import { Link } from 'react-router-dom';
function Travel() {
    const transportData = [
        {
            label: 'Select',
            id: 'select',
            val: 0
        },
        {
            label: 'Train',
            id: 'train',
            val: 644
        },
        {
            label: 'Bus',
            id: 'bus',
            val: 920
        },
        {
            label: 'Car',
            id: 'car',
            val: 1820
        }
    ];

    const planeRadio = [
        {
            id: 'yes',
            label: 'Yes',
            name: 'plane',
            type: 'radio',
            val: 1900
        },
        {
            id: 'no',
            label: 'No',
            name: 'plane',
            type: 'radio',
            val: 0
        }
    ]

    const onChangeTransportVal = (value) => {
        let val = getValueFromObj(foodHabbit, value);
        console.log(val);
    }

    const onChangePlaneRadio = (value) => {
        let val = getValueFromObj(foodHabbit, value);
        console.log(val);
    }


    return (
        <section className='travel-page m-top-3'>
            <div className="container">
                <div className="col-lg-12">
                    <Card>
                        <Card.Header>Form 2/3</Card.Header>
                        <Card.Body>
                            <Card.Title>Travel Habbit</Card.Title>
                            <Card.Text className="text-left">
                                <div className="col-lg-8 offset-2">
                                    <Form>
                                        <Check
                                            label="What mode of transportation you prefer"
                                            data={transportData}
                                            onChange={onChangeTransportVal}
                                        />

                                        <Check
                                            label="Do you travel by plane?"
                                            data={planeRadio}
                                        />
                                    </Form>
                                </div>
                            </Card.Text>

                        </Card.Body>
                        <Card.Footer className="text-right">
                            <Button variant="primary" >
                                <Link className='color-white' to="/house">NEXT</Link>
                            </Button>
                        </Card.Footer>
                    </Card>
                </div>
            </div>
        </section>
    );
}

export default Travel;
